import React from 'react'
import Records from './data.json'

const Afterlogin = () => {
  return (
    <div>
      {
        Records.map( record =>{
            return(
                <div className='table' key={record['Roll No']}>
                    {record.name} <br></br>
                    {record['Roll No']}
                    {record.address}
                    {record.institute}
                    {record.course}
                    
                </div>
            )
        } )
      }
    </div>
  )
}

export default Afterlogin
